    false,nt"url": null,nt"notes": "This narrative report for Izembek, Cold
    Bay, and Aleutian Islands NWRs outlines Refuge accomplishments from January through
    August of 1950. The report begins by summarizing the weather conditions and water
    conditions during this period. Wildlife- including migratory birds and big game
    animals- is also covered. The Refuge development and maintenance section discusses
    physical developments and wildfires. Resource management is outlined; topics include
    fur harvesting. A progress report on field investigations and applied research is
    also provided. The public relations section of the report describes recreational
    uses, Refuge participation, and hunting.",nt"license_title": "License Not
